import Card from "./Card";

const ExpenseForm = () => {
  return (
    <form>
      <div className="new-expense">
        <div className="new-expense-controler">
          <lable>Title</lable>
          <input type="text" />
        </div>
        <div className="new-expense-controler">
          <lable>Amount</lable>
          <input type="number" step="0.01" />
        </div>
        <div className="new-expense-controler">
          <lable>Date</lable>
          <input type="date" />
        </div>
      </div>

      <div className="new-expense-button">
        <button type="submit">Submit</button>
      </div>
    </form>
  );
};

export default ExpenseForm;
